import React, {useState} from "react";

function Note(props) {

    function handleDelete() {
        props.onDelete(props.id)
    }

    return (
    <div className = "note">
      <h1>{props.title}</h1>
      <p>{props.content}</p>
      <button onClick = {handleDelete}>-</button>
    </div>
    );
}

export default Note;
